(53385, 'FC569F09-920F-4D58-AD36-D0F1B84305D2', 'Love I️ appreciate this note. You’ve shared much of this before though and this note doesn’t make me feel like you’re accountable for what I️ asked you to be accountable for. If you are upset about the way I️ asked you a question or the state of the world, there are other ways to share that with me. And I️ ask you to please find other language. You said “leave me alone and stop bothering me.” It was hostile and not nice. That is what I️ am asking you to be accountable to.   And I️ am sorry for asking you the question in a hostile way. I️ didn’t know that’s how it sounded and I️’m sorry for doing that. ', 'Nitzan', 'David', '2022-07-17T11:02:07.068963'),
