(53401, '9684A805-A08E-4AE3-870A-C705D111F685', 'I️ also wanted to make sure you know that I️’m totally cool with you going on a longer bike ride once or twice a month. I️ appreciate that we both give each other space to be in our own element and enjoy the things we appreciate about life. We need that more than ever now. ', 'Nitzan', 'David', '2022-07-17T18:08:11.193632'),
