(53520, '55C22047-21E6-49D1-AB03-CBECCFE6D7D7', 'Sorry love. I think this is a miscommunication. I️ had checked in with you several times this month saying that I really wanted to get together with Ken and you said that that’s ok with you. Then i was supposed to get together with him last last Thursday night but it fell through in the same hour we were supposed to meet. I then shared with you that we were hoping to reschedule for this Thursday night. I️ just never get confirmation from him in advance. So he just confirmed one min ago.', 'Nitzan', 'David', '2022-07-20T16:13:36.021957'),
