(53652, 'CEB11308-73EB-419F-99E3-551A97FACCF8', 'Hi love. Sending you many hugs and kisses as I️ head out to the city. I️’m grateful for our conversation last night and for you helping to lead the way on us reconnecting. I️ know we still need to do more of that - which I️’m eager to do this weekend! I️ feel ready and eager to have you inside of me and to be in your loving arms. I️ know that you’ve been having a hard time recovering from Aspen which makes me sad but i also understand. I also know you’re feeling disappointed about me not initiating on the Joey pose. I️’m sorry for not doing more of that and will initiate more so we do have that as a habit in our relationship understanding that it’s important to you and us. Thanks for being the really thoughtful partner last night and helping us navigate out of a harder space. You are simply wonderful. I️ couldn’t be more grateful for your continuous effort in us. I️ promise to shower you with lots of love and affection as we head into the weekend (specifically after my Schmidt proposal is sent!). You deserve all of that and more. ', 'Nitzan', 'David', '2022-07-21T17:54:39.781291'),
